There is some confusion about the Volume number of this series; many other Deadpool torrents have it as v3 while Marvel officially recognizes it as Volume 2, like so:
 &lt;a href=&quot;
http://marvel.wikia.com/Deadpool_Vol_2&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://marvel.wikia.com/Deadpool_Vol_2&lt;/a&gt;

Since the original owner had these labeled as Vol. 3 in the names of the individual issues, I have only changed the name of the folder as v2. Feel free to relabel the names of the comics themselves as you see fit. 

This is pretty much Deadpool all by his lonesome, doing his assassin thing. all sorts of hilarity ensues - as it frequently does when the Merc with the Mouth is involved. This title is written by Daniel Way with tons of great artists, and has some crossover with major Marvel events like Dark Reign. There are also two special issues, 900 and 1000, that are independent of continuity but could be considered part of this run. I have not included them as they are not available digitally yet and are not necessary. For similar reasons, the 49.1 issue is included but the (I believe) single Annual is not. Thanks to JK-Empire for these digital copies - please seed and enjoy! :-)
